  Shape: Shape,
  Node: Node,
  Edge: Edge,
  Combo: Combo,
  Hull: Hull,
  registerNode: Shape.registerNode,
  registerEdge: Shape.registerEdge,
  registerCombo: Shape.registerCombo,
  registerBehavior: Behavior.registerBehavior,
